import React from "react";
import { useContext } from "react";
import WeeklyInfoContext from "../weeklyInfo/WeeklyInfo";

function BabyInfo() {
  const { babyInfo } = useContext(WeeklyInfoContext);

  return (
    <div>
      <p>Weight: {babyInfo.weight}</p>
      <p>Height: {babyInfo.height}</p>
      <p>General info: {babyInfo.generalInfo}</p>
    </div>
  );
}

export default BabyInfo;
